import React from 'react';

function cart() {
  const vegItems = ['Veggie Burger', 'Salad', 'Grilled Vegetables'];
  return (
    <div>
      <h1>Veg Menu</h1>
      <ul>
        {vegItems.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
}

export default cart;
